           <div className="detailed-conditions">
              <div>Humidity</div> <div> {props.info.humidity} %</div>
            </div>


           <div className="detailed-conditions">
              <div>Wind</div><div> {props.info.wind} km/h</div>
            </div>


            <div className="detailed-conditions">
              <div>visibility</div><div> {props.info.visibility} km</div>
            </div>


          </div>


    );
}
